48a896a0-9f40-11e8-b20f-5f3ed9b1e314	Aplicativo > Quem Somos	ABOUT	TEXT	<h2><strong>Quem Somos</strong></h2><p class="ql-align-justify">A&nbsp;<strong>Bolsa Brasileira de Mercadorias,&nbsp;</strong>mantenedora do aplicativo “Bolsa Agro”, é uma associação civil, sem fins lucrativos, com quadro social constituído por Corretoras de Mercadorias.&nbsp;Sua estrutura administrativa é composta por Assembleia Geral, Conselho de Administração, Diretor Geral e Câmara Arbitral.</p><p class="ql-align-justify">Sediada na cidade de São Paulo e com filiais nas cidades de Porto Alegre/RS, Curitiba/PR e Uberlândia/MG e escritório na cidade do Rio de Janeiro/RJ, seu objetivo é organizar, desenvolver e prover o funcionamento, por meio de sistemas de negociação, de transações com mercadorias, bens e serviços.</p><p class="ql-align-justify">É a Bolsa de Mercadorias do Brasil com o maior número de corretoras associadas e com maior volume de negócios agropecuários realizados.</p><p class="ql-align-justify">As Corretoras de Mercadorias associadas estão submetidas à um Código de Ética e regulamentos internos e são especializadas na comercialização de algodão, arroz, café, feijão, milho, soja, sorgo, trigo e animais e estão estabelecidas nas principais regiões do Brasil onde a comercialização de produtos agropecuários é mais pujante.</p><p class="ql-align-justify">Saiba mais sobre a Bolsa nos canais abaixo:</p><p class="ql-align-justify">Site Institucional:&nbsp;<a href="https://www.bbmnet.com.br/#" target="_blank">www.bbmnet.com.br</a></p><p class="ql-align-justify"><strong>Redes Sociais:&nbsp;</strong><a href="https://pt.wikipedia.org/wiki/Bolsa_Brasileira_de_Mercadorias" target="_blank">Wikipédia</a>&nbsp;|&nbsp;<a href="https://www.facebook.com/bolsabrasileirademercadorias" target="_blank">Facebook</a>&nbsp;|&nbsp;<a href="https://www.youtube.com/channel/UCkja2ra8vT7W5Cl6ecfhtbQ" target="_blank">Youtube</a>&nbsp;|&nbsp;<a href="https://www.linkedin.com/company/bolsa-brasileira-de-mercadorias" target="_blank">Linkedin</a>&nbsp;|&nbsp;<a href="https://plus.google.com/u/0/112447314527005471452/about" target="_blank">Google+</a></p><p class="ql-align-justify"><br></p>	f	2018-08-13 18:31:48	2018-08-28 14:32:26
aba0c070-a0c6-11e8-a05b-333fddfb7efd	Site > Página Quem Somos	ABOUT_PAGE_CONTENT	TEXT	<p><span style="color: rgb(51, 51, 51);">A Bolsa Brasileira de Mercadorias, mantenedora do aplicativo “Bolsa Agro”, é uma associação civil, sem fins lucrativos, com quadro social constituído por mais de 130 Corretoras de Mercadorias. Sua estrutura administrativa é composta por Assembleia Geral, Conselho de Administração, Diretor Geral e Câmara Arbitral. A Bolsa tem mais de 40 anos de experiencia na comercialização de produtos agropecuários. É a Bolsa de Mercadorias do Brasil com o maior número de corretoras associadas e com maior volume de negócios agropecuários realizados.</span></p><p><span style="color: rgb(51, 51, 51);">Sediada na cidade de São Paulo e com filiais nas cidades de Porto Alegre/RS, Curitiba/PR e Uberlândia/MG e Rio de Janeiro/RJ seu objetivo é organizar, desenvolver e prover o funcionamento, por meio de sistemas de negociação, de transações com mercadorias, bens e serviços.</span></p><p><span style="color: rgb(51, 51, 51);">As Corretoras de Mercadorias associadas estão submetidas à um Código de Ética e regulamentos internos e são especializadas na comercialização de algodão, arroz, café, feijão, milho, soja, sorgo, trigo e animais e estão estabelecidas nas principais regiões do Brasil onde a comercialização de produtos agropecuários é mais pujante.</span></p><p><span style="color: rgb(51, 51, 51);">A Bolsa disponibiliza ao mercado avançados sistemas de Registros de Negócios, com certificação digital, e a sua Câmara Arbitral, com o objetivo de oferecer mais segurança nos contratos de compra e venda de produtos agropecuários.</span></p>	f	2018-08-15 17:06:17	2018-08-28 14:32:55
