74a2c020-a0c6-11e8-8f61-c9ed5b5c94b4	Site > Bloco Quem somos na Home	ABOUT_HOME_PAGE_CONTENT	TEXT	<p class="ql-align-justify">A&nbsp;<strong>Bolsa Brasileira de Mercadorias</strong>, mantenedora do aplicativo Bolsa Agro, é uma associação civil sem fins lucrativos, com quadro social constituído por mais de 130 corretoras de mercadorias estabelecidas em várias regiões do Brasil.</p><p class="ql-align-justify">Sediada na cidade de São Paulo (SP)&nbsp;e com filiais nas cidades de Porto Alegre (RS), Curitiba (PR), Uberlândia (MG) e Rio de Janeiro (RJ), seu objetivo é organizar, desenvolver e promover o funcionamento do mercado, por meio de sistemas de negociação, transações com mercadorias, bens e serviços.&nbsp;A Bolsa é resultado da fusão operacional de oito bolsas de mercadorias regionais e tem mais de 40 anos de experiência na comercialização de produtos agropecuários.</p>	f	2018-08-15 17:04:45	2018-08-30 16:06:47
48aa4270-9f40-11e8-923c-8d1213766b62	Site e Aplicativo > Política de Tratamento de Dados	PRIVACY_POLICY	TEXT	<h2><strong>Política de Tratamento de Dados</strong></h2><p>O BOLSA AGRO se preocupa com os dados de seus usuários e tem o compromisso de preservá-los.</p><p>Assim, é necessário conhecer e estar de acordo com nossa Política de Tratamento de Dados, que possui informações claras e completas sobre a coleta, uso, armazenamento, tratamento e proteção de dados e faz parte integrante dos Termos de Uso da Plataforma.</p><p><strong>1) CONSENTIMENTO</strong></p><p>Ao se cadastrar na Plataforma BOLSA AGRO o usuário tomou conhecimento e consentiu expressamente com a coleta, o armazenamento e o uso dos dados já fornecidos e das futuras atualizações desses dados, bem como os dados de tráfego (navegação), endereços IP, entre outros disponibilizados na Plataforma e capturados automaticamente (“Dados”), nos termos que seguem:</p><p><strong>2) DA COLETA E DO TRATAMENTO DE DADOS</strong></p><p>2.1. Dados Informados pelo Usuário:</p><p>Para fins de cadastro, o BOLSA AGRO coleta e armazena dados de seus usuários, como&nbsp;nome, e-mail, CPF&nbsp;e localização. A coleta dessas informações é necessária para viabilizar o acesso e o uso do BOLSA AGRO, bem como para a execução dos serviços disponibilizados aos usuários, conforme nossos Termos de Uso. Tais informações são mantidas em sigilo e segurança, exceto quando o próprio usuário optar por divulgá-las em seus anúncios ou nas hipóteses de compartilhamento mencionadas no item 4 abaixo.</p><p>2.2. Dados Capturados pela Plataforma:</p><p>O BOLSA AGRO também poderá coletar, automaticamente, e armazenar informações, em seus servidores, sobre as atividades advindas do navegador dos seus usuários, incluindo geolocalização, endereços IP; podendo, ainda, enviar e reconhecer cookies, ou outras sequências de caracteres identificadores, afim de agilizar e melhorar a prestação dos serviços disponibilizados aos usuários, conforme nossos Termos de Uso.</p><p>2.3. Dados recebidos de Terceiros</p><p>Caso o Usuário opte por fazer login no BOLSA AGRO por meio de um serviço de autenticação de terceiros, como o Facebook Connect, o BOLSA AGRO poderá receber informações adicionais do perfil deste usuário ou outras informações autorizadas por esse provedor.</p><p>2.4. Dados do Chat, Publicidade.</p><p>O BOLSA AGRO também pode coletar Dados quando os usuários participarem de ações de marketing, publicidade, chat e quando entrarem em contato com o BOLSA AGRO para solicitar ajuda.</p><p>Importante esclarecer que as mensagens trocadas diretamente entre usuários e entre usuários e o BOLSA AGRO por meio do Chat poderão ser armazenadas nos servidores do BOLSA AGRO para obedecer à legislação vigente e para melhorar a qualidade dos serviços disponibilizados aos usuários, pelo período que o BOLSA AGRO entender necessário, mesmo após o encerramento da conta de um determinado usuário, salvo manifestação expressa em contrário por parte do usuário e, nos limites da legislação vigente.</p><p>2.5. Possibilidades de uso dos Dados coletados</p><p>Os Dados coletados serão utilizados para fins legítimos de desenvolvimento e oferecimento de serviços aos usuários e poderão ser usados pelo BOLSA AGRO para melhorar a estratégia de marketing da Plataforma, como veiculação de anúncios, envio de e-mails promocionais e ações de remarketing.</p><p>Nesse sentido, os registros de acesso à plataforma e os Dados coletados poderão ser empregados com as seguintes finalidades:</p><ul><li>Realizar análises e estudos relacionados ao comportamento, interesse e demografia dos usuários, a fim de entender suas demandas, interesses e, dessa forma, prover serviços mais adequados, eficientes e interessantes, melhorando a experiência de usabilidade da plataforma;</li><li>Aperfeiçoar estratégias comerciais e de marketing, objetivando aprimorar os serviços ofertados;</li><li>Enviar, através de mensagens, informações relativas aos produtos, serviços, publicidade, promoções, banners e notícias das plataformas.</li><li>Cruzar, agregar e selecionar os Dados fornecidos pelos usuários ou capturados pela plataforma com Dados obtidos junto a terceiros com a intenção de ampliar o conhecimento sobre os interesses dos usuários e fornecer melhores serviços, bem como oferecer mensagens comerciais e publicitárias mais relevantes para o perfil dos usuários.</li></ul><p><strong>3) PROTEÇÃO DOS DADOS COLETADOS</strong></p><p>Todos os Dados dos usuários obtidos no momento do cadastro, da navegação e da utilização do BOLSA AGRO, ou em qualquer outro momento de contato/comunicação entre o usuário e a plataforma e que sejam armazenados em nossa base de dados, contarão com um ambiente seguro.</p><p>Tais dados serão mantidos pelo prazo mínimo de 06 (seis) meses ou por prazo maior, desde que definido por ordem judicial e ou administrativa, nos termos da legislação em vigor.</p><p>O BOLSA AGRO poderá armazenar e processar os dados ora mencionados em um servidor localizado no Brasil ou no exterior.</p><p><strong>4) DAS HIPÓTESES DE COMPARTILHAMENTO E DIVULGAÇÃO DOS DADOS COLETADOS A TERCEIROS</strong></p><p>O usuário concorda que o BOLSA AGRO poderá compartilhar informações anonimizadas com parceiros, com o objetivo de possibilitar o incremento de suas atividades, proporcionando aos usuários uma melhor experiência na plataforma, ou ainda para fins de continuidade da atividade prestada pelo BOLSA AGRO.</p><p>Dados informados pelos usuários no momento do cadastro no BOLSA AGRO, bem como os coletados diretamente pela plataforma, inclusive os registros de acesso à plataforma (endereço de IP, data, hora e fuso horário) e os dados de identificação e de contato necessários à realização das transações decorrentes das ofertas efetuadas por meio da plataforma poderão ser revelados a terceiros apenas nas seguintes hipóteses:</p><ul><li>a pedido ou por autorização do próprio usuário;</li><li>para que as transações possam ser completadas entre os usuários e os não usuários representados por usuários corretores da plataforma, restando claro ao usuário que, ao responder um chamado (via chat) de um corretor participante da plataforma, estará autorizando a plataforma a fornecer a tal usuário corretor todos os Dados a seu respeito;</li><li>em cumprimento de ordem judicial.</li></ul><p>O usuário também está ciente que o BOLSA AGRO poderá fornecer os dados de contato fornecidos no momento do cadastro na plataforma, tais como nome e endereço de e-mail a não usuários representados por usuários corretores, em caso de: infração aos&nbsp;Termos de Uso,&nbsp;possa provocar danos a outros usuários da plataforma ou a terceiros; suspeita de fraude; disputa ou qualquer indício de ilícito cometido pelo usuário.</p><p><strong>5) SPAM</strong></p><p>Somos contra toda e qualquer prática que promova SPAM de qualquer espécie e temos o compromisso de assegurar que as mensagens enviadas pela plataforma sejam sempre de interesse ou importância para os respectivos destinatários. Além disso, a qualquer momento o usuário pode também optar por parar de receber e-mails do BOLSA AGRO, ajustando suas preferências para recebimento de e-mails ou cancelando sua conta.</p><p><strong>6) ALTERAÇÕES DESTA POLÍTICA DE TRATAMENTO DE DADOS</strong></p><p>O BOLSA AGRO se reserva o direito de, a qualquer momento, alterar esta Política de Tratamento de Dados, atualizando seu conteúdo conforme as necessidades de aperfeiçoamento tecnológico ou de suas funcionalidades.</p><p>Quando houver alteração nesta Política, o BOLSA AGRO comunicará os usuários por meio de publicação a ser disponibilizada em área de destaque na Plataforma, e enviará mensagem de e-mail alertando aos usuários as alterações inseridas na Política e a necessidade de novo consentimento para a continuidade do acesso à plataforma.</p><p>Para esclarecimentos e mais informações sobre esta Política de Tratamento de Dados, entre em contato conosco pelo e-mail bolsaagro@bbmnet.com.br, incluindo no título da mensagem a seguinte frase: “Política de Tratamento de Dados”.</p>	f	2018-08-13 18:31:48	2018-08-15 17:05:02
