48a976e0-9f40-11e8-8a70-4db139874263	Site e Aplicativo > Termos de Uso	TERMS	TEXT	<h2><strong>Termos de Uso</strong></h2><p class="ql-align-justify"><strong><em>Seja bem-vindo!</em></strong></p><p class="ql-align-justify">O aceite destes Termos de Uso é essencial para o uso da plataforma BOLSA AGRO, bem como de todas as suas funcionalidades.</p><p class="ql-align-justify">O BOLSA AGRO é uma plataforma mantida pela Bolsa Brasileira de Mercadorias (www.bbmnet.com.br), disponibilizada pela web e também por aplicativos para celulares. O BOLSA AGRO tem como objetivo permitir que ANUNCIANTES que queiram vender ou comprar produtos agrícolas ou serviços relacionados possam publicar anúncios na plataforma para que corretores associados à Bolsa Brasileira de Mercadorias possam divulgar tais ofertas a potenciais clientes. As transações serão realizadas sempre com o auxílio de um corretor que será responsável pela intermediação da transação.&nbsp;</p><p class="ql-align-justify">O USUÁRIO expressamente declara que tem conhecimento e concorda com os Termos de Uso da Plataforma, inclusive com a Política de Proteção de Dados que, apesar de apresentada em texto separado, é parte integrante deste. O uso da plataforma em discordância com os Termos de Uso poderá implicar a suspensão ou o cancelamento do cadastro do USUÁRIO e eventuais outras sanções, conforme detalhado a seguir.</p><p class="ql-align-justify">DEFINIÇÕES</p><p class="ql-align-justify">Sempre que as expressões abaixo forem usadas em letra maiúscula nestes Termos de Uso, elas terão o significado abaixo:&nbsp;</p><p class="ql-align-justify">a) USUÁRIO – qualquer pessoa física ou jurídica que acesse a plataforma do BOLSA AGRO, independentemente do fato de ter feito ou não o seu cadastro como ANUNCIANTE ou CORRETOR;</p><p class="ql-align-justify">b) ANUNCIANTE – qualquer pessoa que tenha interesse em vender ou comprar um produto agrícola ou um serviço relacionado, divulgando sua intenção através da inserção de um anúncio na plataforma BOLSA AGRO; o ANUNCIANTE poderá ser também um terceiro autorizado a realizar o ANÚNCIO em nome do proprietário da mercadoria, do prestador do serviço relacionado, do interessado na compra do produto ou na contratação do serviço;&nbsp;</p><p class="ql-align-justify">c) COMPRADOR – qualquer pessoa interessada na compra da mercadoria ofertada ou na contratação do serviço relacionado oferecido;&nbsp;</p><p class="ql-align-justify">d) CORRETOR – é o profissional devidamente vinculado a uma Corretora de Mercadorias associada à Bolsa Brasileira de Mercadorias e cadastrado na plataforma BOLSA AGRO como apto a intermediar transações de produtos agrícolas e serviços relacionados;</p><p class="ql-align-justify">e) ANÚNCIO – é a oferta de compra ou venda de mercadorias, bens e serviços relacionados ao agronegócio, publicada pelo ANUNCIANTE na plataforma, contendo a descrição detalhada do produto ou serviço que está sendo ofertado para venda ou compra e o preço para a concretização da transação. Os ANÚNCIOS ficarão disponíveis no BOLSA AGRO pelo prazo de 05 (cinco) dias contados da data de sua publicação na plataforma. Este prazo poderá ser alterado unilateralmente pelo BOLSA AGRO mediante comunicação aos ANUNCIANTES na própria plataforma, respeitando, no entanto, o prazo informado para os ANÚNCIOS que já estiverem sido disponibilizados no BOLSA AGRO;</p><p class="ql-align-justify">f) CHAT – é uma ferramenta disponibilizada na plataforma BOLSA AGRO, que permite a comunicação entre o ANUNCIANTE e o CORRETOR em tempo real, mantendo preservada a identidade do ANUNCIANTE até o momento em que este permitir a divulgação da sua identidade, por meio do envio de qualquer mensagem ao CORRETOR;&nbsp;</p><p class="ql-align-justify">g) TRANSAÇÃO – operação realizada entre o ANUNCIANTE e o COMPRADOR, com o intermédio do CORRETOR, cujo produto ou serviço tenha sido anunciado na plataforma BOLSA AGRO;</p><p class="ql-align-justify">CADASTRO, LOGIN, SENHA E SEGURANÇA</p><p class="ql-align-justify">O USUÁRIO poderá ser pessoa física ou jurídica. É vedado o cadastro de menores de 18 (dezoito) anos na plataforma BOLSA AGRO. Ao utilizar o BOLSA AGRO, o USUÁRIO declara ser maior de 18 anos e estar em plena capacidade para o exercício de todos os atos da vida civil.</p><p class="ql-align-justify">É permitido somente um cadastro por pessoa.&nbsp;</p><p class="ql-align-justify">Será permitido indicar apenas um telefone e apenas um e-mail para a criação de conta e publicação de anúncios de um mesmo USUÁRIO.</p><p class="ql-align-justify">O BOLSA AGRO poderá, a seu critério, efetuar a verificação dos números de telefone e/ou endereços de e-mail indicados, devendo o USUÁRIO confirmar, sob sua responsabilidade, a titularidade de tais informações, estando ciente ainda que o BOLSA AGRO poderá excluir os ANÚNCIOS e cancelar cadastros, caso a qualquer tempo seja verificada a falsidade e/ou invalidade das informações fornecidas ou se detectados múltiplos cadastros para o mesmo USUÁRIO.</p><p class="ql-align-justify">O USUÁRIO será o único responsável por seu login e senha e responderá por todos os atos praticados com estes. Portanto, é dever do USUÁRIO zelar pela guarda e confidencialidade de sua senha. O BOLSA AGRO não será responsável por qualquer perda resultante do uso indevido da senha do USUÁRIO por terceiros.</p><p class="ql-align-justify">O USUÁRIO concorda que o BOLSA AGRO poderá tratar e fornecer a terceiros dados do USUÁRIO da plataforma, conforme detalhado na Política de Tratamento de Dados.&nbsp;</p><p class="ql-align-justify">O USUÁRIO que praticar quaisquer atos em desacordo com estes Termos de Uso poderá ser punido com a suspensão ou o cancelamento de seu cadastro na plataforma, seja como ANUNCIANTE ou como CORRETOR, sem prejuízo de serem tomadas as ações legais cabíveis.</p><p class="ql-align-justify">Nos casos de inabilitação do cadastro do USUÁRIO, todos os ANÚNCIOS ativos serão automaticamente cancelados, não assistindo ao USUÁRIO, por essa razão, qualquer direito de indenização ou ressarcimento.</p><p class="ql-align-justify">REMUNERAÇÃO DA PLATAFORMA&nbsp;</p><p class="ql-align-justify">O acesso à plataforma BOLSA AGRO é gratuito. A Bolsa Brasileira de Mercadorias&nbsp;poderá explorar parte dos espaços da plataforma BOLSA AGRO para fins publicitários, sem que isso gere qualquer direito aos USUÁRIOS.</p><p class="ql-align-justify">USUÁRIOS que queiram ter pleno acesso às informações contidas em cada ANÚNCIO poderão estar sujeitos à assinatura de um termo de adesão e ao pagamento de uma mensalidade/anuidade. Os valores eventualmente cobrados estarão disponíveis em local visível, na página inicial da plataforma.&nbsp;</p><p class="ql-align-justify">RESPONSABILIDADES DO USUÁRIO:</p><p class="ql-align-justify">Os USUÁRIOS:</p><p class="ql-align-justify">(i) assumem todos os riscos relacionados ou resultantes do seu uso, visualização ou acesso ao BOLSA AGRO;</p><p class="ql-align-justify">(ii) são integralmente responsáveis pelas TRANSAÇÕES que forem realizadas com base em ANÚNCIOS na plataforma;</p><p class="ql-align-justify">(iii) não poderão usar SPAM ou qualquer outra prática de divulgação ilegal para promover qualquer ANÚNCIO disponível no BOLSA AGRO;</p><p class="ql-align-justify">(iv) não poderão utilizar a logomarca do BOLSA AGRO sem autorização expressa da plataforma, sendo certo que ANUNCIANTES e CORRETORES podem fazer uso da logomarca com a exclusiva finalidade de indicar aos seus contatos o ANÚNCIO promovido na plataforma.</p><p class="ql-align-justify">O ANUNCIANTE:&nbsp;</p><p class="ql-align-justify">(i) é o único responsável pelos ANÚNCIOS que publica na plataforma;</p><p class="ql-align-justify">(ii) é o legítimo proprietário da mercadoria anunciada na plataforma, ou tem autorização do legítimo proprietário para realizar o ANÚNCIO ou comercializar a mercadoria ou prestar o serviço relacionado, ou ainda, está legitimamente interessado em comprar a mercadoria ou contratar o serviço relacionado no ANÚNCIO;</p><p class="ql-align-justify">(iii) está ciente que será acessado pelo CORRETOR por meio do CHAT da plataforma, com o objetivo de fornecer maiores informações sobre a mercadoria ou o serviço ofertado ou do interesse de compra ou contratação;&nbsp;</p><p class="ql-align-justify">(iv) é responsável por veicular apenas ANÚNCIOS de produtos dentro da validade, que tenham origem, procedência e natureza lícitas, cuja comercialização seja permitida pela legislação brasileira e que não violem qualquer direito de terceiros;</p><p class="ql-align-justify">(v) é responsável por veicular apenas ANÚNCIOS de serviços lícitos e cujos prestadores de serviços respeitem toda legislação brasileira;</p><p class="ql-align-justify">(vi) é responsável por não transmitir qualquer tipo de informação ou conteúdo que constitua publicidade ilícita ou concorrência desleal;</p><p class="ql-align-justify">(vii) é responsável por disponibilizar a mercadoria ou o serviço de acordo com o anunciado, bem como por solucionar quaisquer problemas que porventura ocorrerem no pós-venda;</p><p class="ql-align-justify">(viii) deve respeitar as regras de comissão devidas a CORRETORES que tenham realizado a intermediação da TRANSAÇÃO das mercadorias ou dos serviços anunciados e se responsabilizar diretamente perante os CORRETORES pelo pagamento de tais comissões, isentando o BOLSA AGRO de qualquer responsabilidade nesse sentido;&nbsp;</p><p class="ql-align-justify">(ix) está ciente de que o BOLSA AGRO poderá recusar a publicação do ANÚNCIO, a seu exclusivo critério;&nbsp;</p><p class="ql-align-justify">(x) autoriza o BOLSA AGRO a usar, para fins de publicidade, quaisquer fotografias, imagens, vídeos, áudios e demais conteúdos inseridos nos ANÚNCIOS do BOLSA AGRO;</p><p class="ql-align-justify">(xi) está ciente que o ANÚNCIO poderá ser compartilhado pelos CORRETORES ou pelo BOLSA AGRO através da web, incluindo redes sociais, com o objetivo de abranger o maior número de possíveis interessados;&nbsp;</p><p class="ql-align-justify">(xii) é responsável pelo cumprimento integral de todas as obrigações legais, incluindo obrigações fiscais, relacionadas às TRANSAÇÕES realizadas.</p><p class="ql-align-justify">O CORRETOR:</p><p class="ql-align-justify">&nbsp;(i) é responsável pela correta divulgação dos ANÚNCIOS;</p><p class="ql-align-justify">&nbsp;(ii) é responsável por entrar em contato com o ANUNCIANTE, através do CHAT da plataforma, informando a existência de interessados na compra das mercadorias ou serviços anunciados, bem como por informar as condições ofertadas pelos interessados;&nbsp;</p><p class="ql-align-justify">(iii) é responsável pela condução da negociação entre o ANUNCIANTE e os interessados na compra ou venda da mercadoria ou serviço relacionado;&nbsp;</p><p class="ql-align-justify">(iv) é responsável por prestar informações claras e objetivas sobre o ANÚNCIO ofertado por meio da plataforma.</p><p class="ql-align-justify">OS ANÚNCIOS:</p><p class="ql-align-justify">(i) O ANUNCIANTE deverá elaborar o ANÚNCIO contendo informações claras, completas e precisas que caracterizem bem o produto ou serviço que pretende comercializar. O título e a descrição do ANÚNCIO devem descrever somente o produto e/ou serviço anunciado e o ANÚNCIO deve ser inserido na categoria e subcategoria que melhor descreve o produto ou serviço; produtos ou serviços que não se encaixam na mesma categoria e subcategoria devem ser inseridos em ANÚNCIOS separados;</p><p class="ql-align-justify">(ii) As imagens do ANÚNCIO devem ser relevantes ao produto ou serviço anunciado, embora não sejam obrigatórias;&nbsp;&nbsp;</p><p class="ql-align-justify">(iii) O ANUNCIANTE deverá preencher o campo "preço" com o valor total pretendido do produto, sendo vedado deixá-lo em branco;</p><p class="ql-align-justify">(iv) O produto ou serviço anunciado deve estar no Brasil e na exata região que tiver sido indicada no ANÚNCIO;</p><p class="ql-align-justify">É vedado:</p><p class="ql-align-justify">(i) Inserir ANÚNCIOS que caracterizem mera propaganda do USUÁRIO e que não tenham uma oferta real vinculada;</p><p class="ql-align-justify">(ii) Inserir mais de um ANÚNCIO do mesmo produto/serviço ou de produtos/serviços muito parecidos;</p><p class="ql-align-justify">(iii) Inserir o mesmo ANÚNCIO em diferentes categorias, como por exemplo regiões ou cidades;</p><p class="ql-align-justify">(iv) Utilizar a mesma imagem em ANÚNCIOS diferentes;</p><p class="ql-align-justify">(v) Utilizar quaisquer dispositivos automatizados ou programas de computador que permitam a postagem de ANÚNCIOS no aplicativo sem que cada um deles seja inserido manualmente pelo USUÁRIO, utilizando para tanto dispositivos para envio em massa de ANÚNCIOS, ou o envio de ANÚNCIOS em intervalos regulares.</p><p class="ql-align-justify">(vi) Inserir ANÚNCIOS que contenham palavras que não estejam diretamente relacionadas ao item anunciado ou ainda que tenham o potencial de prejudicar a busca e localização de anúncios de terceiros;</p><p class="ql-align-justify">(v) Inserir ANÚNCIOS que caracterizem cópia de títulos ou descrição de outros ANÚNCIOS;</p><p class="ql-align-justify">(vi) Inserir ANÚNCIOS que possam ser percebidos como obscenos, ofensivos ou que façam apologia a terrorismo, violência ou e/ou discriminatórios a indivíduos, grupos étnicos, religiosos, figuras públicas etc;</p><p class="ql-align-justify">(vii) Inserir ANÚNCIOS com Logotipos de empresas ou imagens de outros ANUNCIANTES e empresas sem a autorização expressa dos mesmos; fotos de crianças, pessoas com traje de banho ou lingerie; imagens que contenham links ou endereço de e-mail ou outros dados de contato;</p><p class="ql-align-justify">(viii) Indicar valores divergentes no campo preço e em outros campos do ANÚNCIO. Caso isso ocorra, os ANÚNCIOS poderão ser removidos a exclusivo critério do BOLSA AGRO;&nbsp;</p><p class="ql-align-justify">(ix) Inserir ANÚNCIOS na categoria ou subcategoria incorreta. Caso isso ocorra, os ANUNCIOS poderão ser removidos da plataforma a exclusivo critério do BOLSA AGRO.&nbsp;</p><p class="ql-align-justify">RESPONSABILIDADES DO BOLSA AGRO:</p><p class="ql-align-justify">(i) o BOLSA AGRO é responsável pelo registro do USUÁRIO e por disponibilizar o ANÚNCIO na plataforma;&nbsp;</p><p class="ql-align-justify">(ii) o BOLSA AGRO não será responsável pelo efetivo cumprimento das obrigações assumidas pelos USUÁRIOS;</p><p class="ql-align-justify">(iii) o BOLSA AGRO envidará todos os esforços para manter a continuidade dos serviços oferecidos pela plataforma. Entretanto, por razões técnicas e que fogem ao controle da plataforma, ela poderá ficar indisponível por algum período;</p><p class="ql-align-justify">(iv) o BOLSA AGRO não se responsabiliza pela existência ou não do produto ou serviço anunciado, tampouco pelo uso indevido da plataforma por terceiros, sejam ANUNCIANTES ou CORRETORES, em especial pelo ANÚNCIO que contenha qualquer oferta ou informação falsa, imprecisa ou incompleta.&nbsp;</p><p class="ql-align-justify">PROPRIEDADE INTELECTUAL</p><p class="ql-align-justify">As informações contidas no site do BOLSA AGRO, bem como sua marca, nome empresarial, nome de domínio, programas, bancos de dados, redes e arquivos são propriedade da Bolsa Brasileira de Mercadorias e estão protegidos pelas leis e tratados internacionais de direito autoral, marcas, patentes, modelos e desenhos industriais, sendo absolutamente vedada a cópia, distribuição, uso ou publicação, total ou parcial, de qualquer material ou parte do site e de todo o conteúdo nele ofertado sem prévia e expressa autorização do titular dos direitos autorais.&nbsp;</p><p class="ql-align-justify">O BOLSA AGRO respeita os direitos de liberdade de expressão, de personalidade e de propriedade intelectual de seus USUÁRIOS e de terceiros. Assim, solicitamos aos nossos USUÁRIOS que também respeitem os direitos dos demais USUÁRIOS da Plataforma e de terceiros.&nbsp;</p><p class="ql-align-justify">O conteúdo dos ANÚNCIOS é de autoria exclusiva dos ANUNCIANTES, que são integralmente responsáveis por todas as promessas e ofertas publicadas no BOLSA AGRO.</p><p class="ql-align-justify">ISENÇÃO DE RESPONSABILIDADE DA PLATAFORMA E INDENIZAÇÃO</p><p class="ql-align-justify">O BOLSA AGRO recomenda que sejam celebrados contratos de compra e venda com cláusula compromissória à Câmara Arbitral da Bolsa Brasileira de Mercadorias ou a outra Câmara Arbitral aprovada pelo Conselho de Administração da Bolsa Brasileira de Mercadorias, com o objetivo de proporcionar mais segurança jurídica aos negócios.</p><p class="ql-align-justify">O BOLSA AGRO não se responsabiliza por danos decorrentes dos negócios conduzidos por USUÁRIOS ou não da plataforma, tampouco pelo cumprimento de quaisquer cláusulas de contratos firmados, limitando-se a disponibilizar espaço para a oferta de mercadorias e serviços por ANUNCIANTES.&nbsp;</p><p class="ql-align-justify">Nos casos em que um ou mais USUÁRIOS ou algum terceiro inicie qualquer tipo de disputa, reclamação ou ação legal contra outro ou outros USUÁRIOS, todos os USUÁRIOS envolvidos nas disputas, reclamações ou ações eximem de toda responsabilidade o BOLSA AGRO e a seus diretores, gerentes, empregados, agentes, operários, representantes e procuradores, inclusive no que tange aos custos e honorários incorridos pelos USUÁRIOS para promover as disputas, reclamações ou ações.&nbsp;</p><p class="ql-align-justify">O USUÁRIO concorda em ressarcir ao BOLSA AGRO, seus empregados, sócios, empresas afiliadas ou subsidiárias quaisquer despesas incorridas com ações judiciais oriundas de ações ou omissões do USUÁRIO que violem os presentes Termos de Uso do BOLSA AGRO, incluindo honorários advocatícios.&nbsp;</p><p class="ql-align-justify">Os USUÁRIOS reconhecem que a plataforma BOLSA AGRO pode conter links para outros sites da rede, o que não significa que esses sites sejam de propriedade ou operados pelo BOLSA AGRO.</p><p class="ql-align-justify">O BOLSA AGRO não se responsabiliza pelos materiais, informações ou conteúdo publicados em sites de terceiros, tampouco pela disponibilidade destes sites, competindo exclusivamente ao USUÁRIO usar seu próprio discernimento, precaução e senso comum ao acessar sites de terceiros, devendo conferir as políticas de privacidade e os termos de uso aplicáveis.</p><p class="ql-align-justify">O USUÁRIO reconhece e concorda que o BOLSA AGRO não se responsabiliza (i) por qualquer dano, prejuízo ou perda no equipamento do USUÁRIO causada por falhas no sistema, no servidor ou na internet decorrentes de condutas de terceiros; (ii) por danos decorrentes de ataques de vírus ao equipamento do USUÁRIO em decorrência do acesso, utilização ou navegação no BOLSA AGRO ou como consequência da transferência de dados, arquivos, imagens, textos ou áudio contidos no mesmo.</p><p class="ql-align-justify">Os USUÁRIOS isentam o BOLSA AGRO de responsabilidade por danos suportados em virtude de prejuízos resultantes de dificuldades técnicas ou falhas nos sistemas ou na internet.</p><p class="ql-align-justify">O BOLSA AGRO poderá encerrar, suspender ou interromper, a seu exclusivo critério, quaisquer serviços oferecidos e remover quaisquer ANÚNCIOS nele publicados, sem obrigatoriedade de aviso prévio aos USUÁRIOS. O BOLSA AGRO poderá também restringir o acesso de USUÁRIOS a qualquer parte ou a todos os serviços oferecidos pelo BOLSA AGRO a qualquer momento, com ou sem justa causa ou notificação prévia, e por qualquer razão ou motivo.&nbsp;</p><p class="ql-align-justify">Estes Termos não geram nenhum contrato de sociedade, de mandato, parceria, franquia ou relação de trabalho entre o BOLSA AGRO e o</p><p class="ql-align-justify">USUÁRIO. O USUÁRIO está ciente e de acordo que o BOLSA AGRO não possui controle algum sobre a qualidade, segurança, entrega ou legalidade dos produtos ou serviços anunciados, sobre a veracidade ou exatidão dos ANÚNCIOS.</p><p class="ql-align-justify">MODIFICAÇÕES NOS TERMOS DE USO&nbsp;</p><p class="ql-align-justify">Quando houver alteração nos Termos de Uso do BOLSA AGRO, o USUÁRIO será comunicado através de e-mail ou de publicação em área de destaque na Plataforma.</p><p class="ql-align-justify">LEI APLICÁVEL</p><p class="ql-align-justify">Estes Termos de Uso apresentam as normas aplicáveis ao uso da plataforma BOLSA AGRO, cujos direitos de uso exclusivo no Brasil pertencem à BOLSA BRASILEIRA DE MERCADORIAS, inscrita no CNPJ sob n. 05.342.088/0001-43, com endereço na Rua São Bento n. 470 – 14º. Andar – CEP: 01010-001 – Centro – São Paulo – SP, única e exclusiva proprietária do domínio https://www.bolsaagro.com.br.</p><p class="ql-align-justify">Estes Termos são regidos única e exclusivamente pelas leis brasileiras, sendo que qualquer ação judicial relativa à sua interpretação ou aplicação deverá ser processada e julgada pelo Poder Judiciário Brasileiro.&nbsp;&nbsp;</p><p class="ql-align-justify">Em caso de conflito de leis estaduais ou municipais, para a interpretação de qualquer dúvida ou litígio, deverá sempre prevalecer a legislação do Estado de São Paulo.</p>	f	2018-08-13 18:31:48	2018-08-17 16:07:29
